import graphic1 from "./imgs/f21.png";
import graphic2 from "./imgs/ok-rating.png";

function BrandSearchPage() {

  state = {
    names: [
      "Forever 21",
      "Forever Alone",
      "Forver Young",
    ],
    searchTerm: ''
  }

  editSearchTerm = (e) => {
    this.setState({searchTerm: e.target.value})
  }

  dynamicSearch = () => {
    return this.state.names.filter(name => name.toLowerCase().includes(this.state.searchTerm.toLowerCase()))
  }

  return (

    <div>
        <div class = "container" style = {{display: "flex", flexDirection: "column", justifyContent:"center", marginBottom: 0,}}>
            <p style = {{fontSize: 50}}>Search for a brand you want to learn about</p>

            <div style ={{width:"80vw"}}>
              <div class = "row-container" style = {{justifyItems:"center", height: "5vh", marginBottom: "10px"}}>
                <input id = "searchbar" value = {this.state.searchTerm} onChange = {this.editSearchTerm} type="text" placeholder="Search.."></input>
                <button id = "searchbar">All categories</button>
                <button id = "searchbar">Search</button>
              </div>
              <div id = "search-item" class = "row-container" style = {{marginBottom: "0px"}}>
                  <div>
                    <img id = "brand-logo" src = {graphic1}></img>
                  </div>
                  <div class = "container" style = {{marginLeft: "30px", alignItems:"flex-start", marginBottom: "0px", flexDirection:"column",}}>
                    <p>Forever 21</p>
                    <div class = "row-container" style = {{marginBottom: "0px"}}>
                      <p style = {{fontWeight:"lighter", color: "#999FAA"}} >Last Updated</p>
                      <p style = {{fontWeight:"lighter", color: "#999FAA",marginLeft: "15px"}}>January 13, 2021</p>
                    </div>
                  </div>

                  <img id = "smiley" src = {graphic2}></img>
              </div>
            </div>
        </div>
    </div>
  );
}

export default BrandSearchPage;
